import React from 'react';
import {Card, Button, Image} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../../src/app.css';

import Compass from "../resources/icons/100w/XMCompass_100px.png";
import Pawprint from "../resources/icons/100w/XMPawprint_100px.png";
import Book from "../resources/icons/100w/XMBook_100px.png";
import Team from "../resources/icons/100w/XMTeam_100px.png";
import Contact from "../resources/icons/100w/XMContact_100px.png";


class Sidebar extends React.Component{
    render(){
        return(
        <div className="main-sidebar">
            <Link to="./XM-Website/feed"><div className="sidebar-button"><Image src={Compass}/></div></Link>
            <Link to="./XM-Website/projects"><div className="sidebar-button"><Image src={Pawprint}/></div></Link>
            <Link to="./XM-Website/bookstack"><div className="sidebar-button"><Image src={Book}/></div></Link>
            <Link to="./XM-Website/team"><div className="sidebar-button"><Image src={Team}/></div></Link>
            <Link to="./XM-Website/contact"><div className="sidebar-button"><Image src={Contact}/></div></Link>
        </div>
        );
    }    
}

export default Sidebar;
